import React from "react";
import './Teamweb.css';
import { Secretariatwebjr } from './Dataset';
import {HiOutlineMail} from 'react-icons/hi';
import {FaLinkedinIn} from 'react-icons/fa';
import {FaFacebookF} from 'react-icons/fa';
export default function(){
    return(
           <>
           <div className="team-head4">
           <h1 className="team-head-h1">Web Development Team</h1>
           </div>
        <div className="team-stats-card4">
           {Secretariatwebjr.map((item) => {
               return(
                       <div key={item.id} className="team-stats4">
                       <div>
                           <center><img className="team-img4" src={item.imgsrc} alt="" /></center>
                        </div>


                        <div className="social-media">
                        <div className="icon1">
                            <a href="mailto:abc@pm.me"><HiOutlineMail size={30} /></a>
                        </div>
                        <div className="icon2">
                        <a href="https://www.linkedin.com/" target="_blank"><FaLinkedinIn size={30} /></a>
                        </div>
                        <div className="icon3">
                        <a href="https://github.com" target="_blank"><FaFacebookF size={30} /></a>
                        </div>
                        </div>



                       <h1>{item.name}</h1>
                       <h2 className="team-posting-sec">{item.post}</h2>
                    </div>
               )
           })}
           </div>
           </>
    )
}
